import SectionTitle from './components/SectionTitle/SectionTitle';
import AirportCard from './components/AirportCart/AirportCard';
im




function App() {
  return (
    <div className="p-8">
      <SectionTitle />

    	<AirportCard
			image="./img/Frankfurt.jpg"
			city="Frankfurt am Main - Frankfurt International Airport (FRA)"
			price={450}
			currency="EUR"
   	 	/>

		<AirportCard
			image="/img/munich.jpg"
			city="Munich International Airport (MUC)"
			price={450}
			currency="EUR"
    	/>

		<CarouselNavigation/>
    </div>
  );
}

export default App;
